
The YH genome was assembled based on 3.3 billion reads using the Illumina Genome Analyzer.  We achieved 117.7G nucleotides data and the genome was sequenced to 36-fold average coverage.  By aligning the short reads with SOAP, 102.9G nucleotides were mapped onto the NCBI reference genome and 99.97% of the genome was covered.  The raw sequences, alignments, consensus genome, variants and relevant tools are released for public use under a <a href="http://creativecommons.org/about/cc0">CC0 license</a>.', 478888853504, 'ftp://climb.genomics.cn/pub/10.5524/100001_101000/100015/', 'Published', 'GigaDBUploadForm_YHGenome.xls', 'a0e790fb523a8fb5427c62187a1ff704', '2011/07/06', null, 1 );
